CREATE DEFINER=`bammobic`@`localhost` PROCEDURE `GetInfoByPIN` (IN `inputPIN` TEXT)  NO SQL
SELECT 
Product.Image as Image,
Product.Name as Name,
Product.Style as Style,
SellProduct.SellPrice as Price,
Product.Weight as Weight,
Customer.Name as CustomerName,
Customer.Phone as CustomerPhone,
Customer.Address as CustomerAddress,
SellProduct.Description AS Description,
FullCus.CurrentPoint AS CurrentPoint

FROM SellProduct
INNER JOIN Product ON SellProduct.ProductId = Product.Id
INNER JOIN Customer ON SellProduct.CustomerId = Customer.Id
INNER JOIN
(
	SELECT 
    `Customer`.`Id` AS `Id`,    
    (ROUND(SUM(`SellProduct`.`SellPrice`)/100000,0)-`Customer`.`UsedPoint`) AS `CurrentPoint`
    FROM `Customer` 
    INner Join `SellProduct` ON `SellProduct`.`CustomerId` = `Customer`.`Id`
    GROUP BY `Customer`.`Id`
    
) AS FullCus
ON (SellProduct.PIN = inputPIN AND `SellProduct`.`CustomerId` = `FullCus`.`Id`)
WHERE SellProduct.PIN = inputPIN$$

