CREATE DEFINER=`bammobic`@`localhost` PROCEDURE `TrackingByPIN` (IN `inputPIN` TEXT)  NO SQL
SELECT 
StateRecord.Id as Id,
StateRecord.Date as StateDate,
State.Content as StateContent,
StateRecord.Description as Description,
SellProduct.PIN as PIN
FROM SellProduct
INNER JOIN StateRecord ON StateRecord.SellProductId = SellProduct.Id
INNER JOIN State ON State.Id = StateRecord.StateId

WHERE SellProduct.PIN = inputPIN
Order By StateRecord.StateId desc, StateRecord.Date desc$$

