	StateRecord.Description As Description,
	StateRecord.Tracking As Tracking,
	StateRecord.ServiceName As Service
From SellProduct
Inner Join StateRecord
On StateRecord.SellProductId = SellProduct.Id
Inner Join State
On StateRecord.StateId = State.Id
Where SellProduct.Id = p_Id
Order By StateRecord.Id DESC$$

CREATE DEFINER=`bammobic`@`localhost` PROCEDURE `UpdateTax` (IN `month` INT)  NO SQL
Begin 
UPDATE `SellProduct` SET `Tax`= 10

WHERE  Month(`DateOpen`) = month
AND `BuyPrice`>=100
AND `Tax` = 0
AND ProductId Not In
(
	Select Id from `Product`
    Where `CategoryId` = 1
    OR `CategoryId` = 2
    OR `CategoryId` = 5
    OR `CategoryId` = 6
    OR `CategoryId` = 7
    OR `CategoryId` = 8
    OR `CategoryId` = 9
    OR `CategoryId` = 10
);

UPDATE `SellProduct` SET `Tax`= `BuyPrice`*10/100

WHERE  Month(`DateOpen`) = month
AND `BuyPrice`<100
AND `Tax` = 0
AND ProductId Not In
(
	Select Id from `Product`
    Where `CategoryId` = 1
    OR `CategoryId` = 2
    OR `CategoryId` = 5
    OR `CategoryId` = 6
    OR `CategoryId` = 7
    OR `CategoryId` = 8
    OR `CategoryId` = 9
    OR `CategoryId` = 10
);


UPDATE `SellProduct` SET `DeliFee`= 15000

WHERE  Month(`DateOpen`) = month
AND `DeliFee` = 0;


End$$

